CREATE DEFINER=`root`@`localhost` PROCEDURE `inv_transactions_GetAnalytics` (IN `p_UserName` VARCHAR(100), IN `p_IsAdmin` BOOLEAN, IN `p_FromDate` DATETIME, IN `p_ToDate` DATETIME, OUT `p_Status` INT, OUT `p_ErrorMsg` VARCHAR(500))   BEGIN
    
    
    DECLARE v_Count INT DEFAULT 0;
    
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
        GET DIAGNOSTICS CONDITION 1
            @sqlstate = RETURNED_SQLSTATE,
            @errno = MYSQL_ERRNO,
            @text = MESSAGE_TEXT;
        SET p_Status = -1;
        SET p_ErrorMsg = CONCAT('Database error: ', @text);
    END;
    
    
    SELECT 
        COUNT(*) as TotalTransactions,
        SUM(CASE WHEN TransactionType = 'IN' THEN 1 ELSE 0 END) as TotalIN,
        SUM(CASE WHEN TransactionType = 'OUT' THEN 1 ELSE 0 END) as TotalOUT,
        SUM(CASE WHEN TransactionType = 'TRANSFER' THEN 1 ELSE 0 END) as TotalTRANSFER
    FROM inv_transaction
    WHERE (p_IsAdmin OR p_UserName IS NULL OR LENGTH(TRIM(p_UserName)) = 0 OR User = p_UserName)
      AND (p_FromDate IS NULL OR ReceiveDate >= p_FromDate)
      AND (p_ToDate IS NULL OR ReceiveDate <= p_ToDate);
    
    
    SELECT 
        COALESCE(SUM(Quantity), 0) as TotalQuantityMoved,
        COALESCE(SUM(CASE WHEN TransactionType = 'IN' THEN Quantity ELSE 0 END), 0) as QuantityIN,
        COALESCE(SUM(CASE WHEN TransactionType = 'OUT' THEN Quantity ELSE 0 END), 0) as QuantityOUT,
        COALESCE(SUM(CASE WHEN TransactionType = 'TRANSFER' THEN Quantity ELSE 0 END), 0) as QuantityTRANSFER
    FROM inv_transaction
    WHERE (p_IsAdmin OR p_UserName IS NULL OR LENGTH(TRIM(p_UserName)) = 0 OR User = p_UserName)
      AND (p_FromDate IS NULL OR ReceiveDate >= p_FromDate)
      AND (p_ToDate IS NULL OR ReceiveDate <= p_ToDate);
    
    
    SELECT 
        MIN(ReceiveDate) as FirstTransactionDate,
        MAX(ReceiveDate) as LastTransactionDate
    FROM inv_transaction
    WHERE (p_IsAdmin OR p_UserName IS NULL OR LENGTH(TRIM(p_UserName)) = 0 OR User = p_UserName)
      AND (p_FromDate IS NULL OR ReceiveDate >= p_FromDate)
      AND (p_ToDate IS NULL OR ReceiveDate <= p_ToDate);
    
    
    SELECT 
        COALESCE(User, '') as UserName,
        COUNT(*) as TransactionCount
    FROM inv_transaction
    WHERE (p_IsAdmin OR p_UserName IS NULL OR LENGTH(TRIM(p_UserName)) = 0 OR User = p_UserName)
      AND (p_FromDate IS NULL OR ReceiveDate >= p_FromDate)
      AND (p_ToDate IS NULL OR ReceiveDate <= p_ToDate)
      AND User IS NOT NULL
      AND User != ''
    GROUP BY User
    ORDER BY COUNT(*) DESC
    LIMIT 1;
    
    
    SELECT 
        COALESCE(PartID, '') as PartID,
        COUNT(*) as TransactionCount
    FROM inv_transaction
    WHERE (p_IsAdmin OR p_UserName IS NULL OR LENGTH(TRIM(p_UserName)) = 0 OR User = p_UserName)
      AND (p_FromDate IS NULL OR ReceiveDate >= p_FromDate)
      AND (p_ToDate IS NULL OR ReceiveDate <= p_ToDate)
      AND PartID IS NOT NULL
      AND PartID != ''
    GROUP BY PartID
    ORDER BY COUNT(*) DESC
    LIMIT 1;
    
    
    
    SELECT 
        Location as LocationName,
        COUNT(*) as TransactionCount
    FROM (
        SELECT FromLocation as Location
        FROM inv_transaction
        WHERE (p_IsAdmin OR p_UserName IS NULL OR LENGTH(TRIM(p_UserName)) = 0 OR User = p_UserName)
          AND (p_FromDate IS NULL OR ReceiveDate >= p_FromDate)
          AND (p_ToDate IS NULL OR ReceiveDate <= p_ToDate)
          AND FromLocation IS NOT NULL
          AND FromLocation != ''
          AND FromLocation NOT IN ('FLOOR', 'RECEIVING', 'SHIPPING')  
        
        UNION ALL
        
        SELECT ToLocation as Location
        FROM inv_transaction
        WHERE (p_IsAdmin OR p_UserName IS NULL OR LENGTH(TRIM(p_UserName)) = 0 OR User = p_UserName)
          AND (p_FromDate IS NULL OR ReceiveDate >= p_FromDate)
          AND (p_ToDate IS NULL OR ReceiveDate <= p_ToDate)
          AND ToLocation IS NOT NULL
          AND ToLocation != ''
          AND ToLocation NOT IN ('FLOOR', 'RECEIVING', 'SHIPPING')  
    ) AS AllLocations
    GROUP BY Location
    ORDER BY COUNT(*) DESC
    LIMIT 1;
    
    
    SELECT 
        COALESCE(PartID, '') as PartID,
        COUNT(*) as TransferCount
    FROM inv_transaction
    WHERE (p_IsAdmin OR p_UserName IS NULL OR LENGTH(TRIM(p_UserName)) = 0 OR User = p_UserName)
      AND (p_FromDate IS NULL OR ReceiveDate >= p_FromDate)
      AND (p_ToDate IS NULL OR ReceiveDate <= p_ToDate)
      AND TransactionType = 'TRANSFER'
      AND PartID IS NOT NULL
      AND PartID != ''
    GROUP BY PartID
    ORDER BY COUNT(*) DESC
    LIMIT 1;
    
    
    SELECT 
        DAYNAME(ReceiveDate) as DayName,
        COUNT(*) as TransactionCount
    FROM inv_transaction
    WHERE (p_IsAdmin OR p_UserName IS NULL OR LENGTH(TRIM(p_UserName)) = 0 OR User = p_UserName)
      AND (p_FromDate IS NULL OR ReceiveDate >= p_FromDate)
      AND (p_ToDate IS NULL OR ReceiveDate <= p_ToDate)
    GROUP BY DAYOFWEEK(ReceiveDate), DAYNAME(ReceiveDate)
    ORDER BY COUNT(*) DESC
    LIMIT 1;
    
    
    SELECT 
        HOUR(ReceiveDate) as Hour,
        COUNT(*) as TransactionCount
    FROM inv_transaction
    WHERE (p_IsAdmin OR p_UserName IS NULL OR LENGTH(TRIM(p_UserName)) = 0 OR User = p_UserName)
      AND (p_FromDate IS NULL OR ReceiveDate >= p_FromDate)
      AND (p_ToDate IS NULL OR ReceiveDate <= p_ToDate)
    GROUP BY HOUR(ReceiveDate)
    ORDER BY COUNT(*) DESC
    LIMIT 1;
    
    
    
    SELECT 
        
        CASE 
            WHEN p_FromDate IS NOT NULL AND p_ToDate IS NOT NULL AND DATEDIFF(p_ToDate, p_FromDate) > 0 
            THEN (
                SELECT COUNT(*) 
                FROM inv_transaction 
                WHERE (p_IsAdmin OR p_UserName IS NULL OR LENGTH(TRIM(p_UserName)) = 0 OR User = p_UserName)
                  AND ReceiveDate BETWEEN p_FromDate AND p_ToDate
            ) / DATEDIFF(p_ToDate, p_FromDate)
            ELSE (
                SELECT COUNT(*) 
                FROM inv_transaction 
                WHERE (p_IsAdmin OR p_UserName IS NULL OR LENGTH(TRIM(p_UserName)) = 0 OR User = p_UserName)
                  AND (p_FromDate IS NULL OR ReceiveDate >= p_FromDate)
                  AND (p_ToDate IS NULL OR ReceiveDate <= p_ToDate)
            )
        END as TransactionRate,
        
        
        CASE 
            WHEN p_FromDate IS NOT NULL AND p_ToDate IS NOT NULL AND DATEDIFF(p_ToDate, p_FromDate) > 1 THEN
                CASE 
                    WHEN (
                        SELECT COUNT(*) 
                        FROM inv_transaction 
                        WHERE (p_IsAdmin OR p_UserName IS NULL OR LENGTH(TRIM(p_UserName)) = 0 OR User = p_UserName)
                          AND ReceiveDate BETWEEN 
                            DATE_ADD(p_FromDate, INTERVAL DATEDIFF(p_ToDate, p_FromDate) / 2 DAY) 
                            AND p_ToDate
                    ) > (
                        SELECT COUNT(*) 
                        FROM inv_transaction 
                        WHERE (p_IsAdmin OR p_UserName IS NULL OR LENGTH(TRIM(p_UserName)) = 0 OR User = p_UserName)
                          AND ReceiveDate BETWEEN 
                            p_FromDate 
                            AND DATE_ADD(p_FromDate, INTERVAL DATEDIFF(p_ToDate, p_FromDate) / 2 DAY)
                    )
                    THEN 'Increasing'
                    WHEN (
                        SELECT COUNT(*) 
                        FROM inv_transaction 
                        WHERE (p_IsAdmin OR p_UserName IS NULL OR LENGTH(TRIM(p_UserName)) = 0 OR User = p_UserName)
                          AND ReceiveDate BETWEEN 
                            DATE_ADD(p_FromDate, INTERVAL DATEDIFF(p_ToDate, p_FromDate) / 2 DAY) 
                            AND p_ToDate
                    ) < (
                        SELECT COUNT(*) 
                        FROM inv_transaction 
                        WHERE (p_IsAdmin OR p_UserName IS NULL OR LENGTH(TRIM(p_UserName)) = 0 OR User = p_UserName)
                          AND ReceiveDate BETWEEN 
                            p_FromDate 
                            AND DATE_ADD(p_FromDate, INTERVAL DATEDIFF(p_ToDate, p_FromDate) / 2 DAY)
                    )
                    THEN 'Decreasing'
                    ELSE 'Stable'
                END
            ELSE 'Stable'
        END as TransactionRateTrend;
    
    
    SELECT COUNT(*) INTO v_Count
    FROM inv_transaction
    WHERE (p_IsAdmin OR p_UserName IS NULL OR LENGTH(TRIM(p_UserName)) = 0 OR User = p_UserName)
      AND (p_FromDate IS NULL OR ReceiveDate >= p_FromDate)
      AND (p_ToDate IS NULL OR ReceiveDate <= p_ToDate);
    
    IF v_Count > 0 THEN
        SET p_Status = 0;
        SET p_ErrorMsg = 'Analytics retrieved successfully';
    ELSE
        SET p_Status = 1;
        SET p_ErrorMsg = 'No transaction data found for analytics';
    END IF;
    
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `inv_transactions_GetBatchLifecycle` (IN `p_BatchNumber` VARCHAR(50), OUT `p_Status` INT, OUT `p_ErrorMsg` VARCHAR(500))   BEGIN
    DECLARE v_Count INT DEFAULT 0;
    
    
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
        GET DIAGNOSTICS CONDITION 1
            p_ErrorMsg = MESSAGE_TEXT;
        SET p_Status = -1;
    END;
    
    
    IF p_BatchNumber IS NULL OR TRIM(p_BatchNumber) = '' THEN
        SET p_Status = -2;
        SET p_ErrorMsg = 'Batch number is required';
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Batch number is required';
    END IF;
    
    
    SELECT COUNT(*)
    INTO v_Count
    FROM inv_transaction
    WHERE BatchNumber = p_BatchNumber;
    
    
    SELECT 
        ID,
        TransactionType,
        PartID,
        BatchNumber,
        Quantity,
        FromLocation,
        ToLocation,
        Operation,
        User,
        ReceiveDate,
        ItemType,
        Notes
    FROM inv_transaction
    WHERE BatchNumber = p_BatchNumber
    ORDER BY ReceiveDate ASC;
    
    
    IF v_Count > 0 THEN
        SET p_Status = 1;
        SET p_ErrorMsg = CONCAT('Found ', v_Count, ' transaction(s) for batch ', p_BatchNumber);
    ELSE
        SET p_Status = 0;
        SET p_ErrorMsg = CONCAT('No transactions found for batch ', p_BatchNumber);
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `inv_transactions_Search` (IN `p_UserName` VARCHAR(100), IN `p_IsAdmin` BOOLEAN, IN `p_PartID` VARCHAR(300), IN `p_BatchNumber` VARCHAR(300), IN `p_FromLocation` VARCHAR(100), IN `p_ToLocation` VARCHAR(100), IN `p_Operation` VARCHAR(100), IN `p_TransactionType` VARCHAR(50), IN `p_Quantity` INT, IN `p_Notes` VARCHAR(1000), IN `p_ItemType` VARCHAR(100), IN `p_FromDate` DATETIME, IN `p_ToDate` DATETIME, IN `p_SortColumn` VARCHAR(100), IN `p_SortDescending` BOOLEAN, IN `p_Page` INT, IN `p_PageSize` INT, OUT `p_Status` INT, OUT `p_ErrorMsg` VARCHAR(500))   BEGIN
    DECLARE v_Count INT DEFAULT 0;
    DECLARE v_Offset INT DEFAULT 0;
    DECLARE v_OrderBy VARCHAR(200) DEFAULT 'ORDER BY ReceiveDate DESC';
    
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
        GET DIAGNOSTICS CONDITION 1
            p_ErrorMsg = MESSAGE_TEXT;
        SET p_Status = -1;
    END;
    
    IF p_Page < 1 THEN SET p_Page = 1; END IF;
    IF p_PageSize < 1 OR p_PageSize > 1000 THEN SET p_PageSize = 20; END IF;
    SET v_Offset = (p_Page - 1) * p_PageSize;
    
    
    IF p_SortColumn IS NOT NULL AND TRIM(p_SortColumn) != '' THEN
        SET v_OrderBy = CONCAT('ORDER BY ', p_SortColumn);
        IF p_SortDescending THEN
            SET v_OrderBy = CONCAT(v_OrderBy, ' DESC');
        ELSE
            SET v_OrderBy = CONCAT(v_OrderBy, ' ASC');
        END IF;
    END IF;
    
    
    SELECT COUNT(*)
    INTO v_Count
    FROM inv_transaction

    WHERE 1=1
        
        
        AND (
            (TRIM(COALESCE(p_UserName, '')) != '' AND User = p_UserName)  
            OR (TRIM(COALESCE(p_UserName, '')) = '' AND p_IsAdmin = TRUE)  
            OR (TRIM(COALESCE(p_UserName, '')) = '' AND p_IsAdmin = FALSE)  
        )
        
        AND (TRIM(COALESCE(p_PartID, '')) = '' OR PartID LIKE CONCAT('%', p_PartID, '%'))
        
        AND (TRIM(COALESCE(p_BatchNumber, '')) = '' OR BatchNumber LIKE CONCAT('%', p_BatchNumber, '%'))
        
        AND (TRIM(COALESCE(p_FromLocation, '')) = '' OR FromLocation = p_FromLocation)
        
        AND (TRIM(COALESCE(p_ToLocation, '')) = '' OR ToLocation = p_ToLocation)
        
        AND (TRIM(COALESCE(p_Operation, '')) = '' OR Operation = p_Operation)
        
        AND (TRIM(COALESCE(p_TransactionType, '')) = '' OR TransactionType = p_TransactionType)
        
        AND (p_Quantity IS NULL OR Quantity = p_Quantity)
        
        AND (TRIM(COALESCE(p_Notes, '')) = '' OR Notes LIKE CONCAT('%', p_Notes, '%'))
        
        AND (TRIM(COALESCE(p_ItemType, '')) = '' OR ItemType = p_ItemType)
        
        AND (p_FromDate IS NULL OR ReceiveDate >= p_FromDate)
        AND (p_ToDate IS NULL OR ReceiveDate <= p_ToDate);
    
    
    SELECT 
        ID,
        TransactionType,
        BatchNumber,
        PartID,
        FromLocation,
        ToLocation,
        Operation,
        Quantity,
        Notes,
        User,
        ItemType,
        ReceiveDate
    FROM inv_transaction
    WHERE 1=1
        
        AND (
            (TRIM(COALESCE(p_UserName, '')) != '' AND User = p_UserName)
            OR (TRIM(COALESCE(p_UserName, '')) = '' AND p_IsAdmin = TRUE)
            OR (TRIM(COALESCE(p_UserName, '')) = '' AND p_IsAdmin = FALSE)
        )
        AND (TRIM(COALESCE(p_PartID, '')) = '' OR PartID LIKE CONCAT('%', p_PartID, '%'))
        AND (TRIM(COALESCE(p_BatchNumber, '')) = '' OR BatchNumber LIKE CONCAT('%', p_BatchNumber, '%'))
        AND (TRIM(COALESCE(p_FromLocation, '')) = '' OR FromLocation = p_FromLocation)
        AND (TRIM(COALESCE(p_ToLocation, '')) = '' OR ToLocation = p_ToLocation)
        AND (TRIM(COALESCE(p_Operation, '')) = '' OR Operation = p_Operation)
        AND (TRIM(COALESCE(p_TransactionType, '')) = '' OR TransactionType = p_TransactionType)
        AND (p_Quantity IS NULL OR Quantity = p_Quantity)
        AND (TRIM(COALESCE(p_Notes, '')) = '' OR Notes LIKE CONCAT('%', p_Notes, '%'))
        AND (TRIM(COALESCE(p_ItemType, '')) = '' OR ItemType = p_ItemType)
        AND (p_FromDate IS NULL OR ReceiveDate >= p_FromDate)
        AND (p_ToDate IS NULL OR ReceiveDate <= p_ToDate)
    ORDER BY 
        CASE WHEN p_SortColumn = 'ReceiveDate' AND p_SortDescending THEN ReceiveDate END DESC,
        CASE WHEN p_SortColumn = 'ReceiveDate' AND NOT p_SortDescending THEN ReceiveDate END ASC,
        CASE WHEN p_SortColumn = 'PartID' AND p_SortDescending THEN PartID END DESC,
        CASE WHEN p_SortColumn = 'PartID' AND NOT p_SortDescending THEN PartID END ASC,
        CASE WHEN p_SortColumn = 'Quantity' AND p_SortDescending THEN Quantity END DESC,
        CASE WHEN p_SortColumn = 'Quantity' AND NOT p_SortDescending THEN Quantity END ASC,
        CASE WHEN p_SortColumn = 'User' AND p_SortDescending THEN User END DESC,
        CASE WHEN p_SortColumn = 'User' AND NOT p_SortDescending THEN User END ASC,
        ReceiveDate DESC
    LIMIT v_Offset, p_PageSize;
    
    IF v_Count > 0 THEN
        SET p_Status = 1;
        SET p_ErrorMsg = CONCAT('Found ', v_Count, ' transaction(s) matching criteria');
    ELSE
        SET p_Status = 0;
        SET p_ErrorMsg = 'No transactions found matching search criteria';
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `inv_transactions_SmartSearch` (IN `p_WhereClause` TEXT, IN `p_Page` INT, IN `p_PageSize` INT, OUT `p_Status` INT, OUT `p_ErrorMsg` VARCHAR(500))   BEGIN
    DECLARE v_Count INT DEFAULT 0;
    DECLARE v_ErrorMessage VARCHAR(500) DEFAULT '';
    DECLARE v_Offset INT DEFAULT 0;
    DECLARE v_FinalWhereClause TEXT DEFAULT '';
    
    BEGIN
        GET DIAGNOSTICS CONDITION 1
            @sqlstate = RETURNED_SQLSTATE,
            @errno = MYSQL_ERRNO,
            @text = MESSAGE_TEXT;
        SET p_Status = -1;
        SET p_ErrorMsg = CONCAT('Database error: ', @text);
    END;
    IF p_Page < 1 THEN SET p_Page = 1; END IF;
    IF p_PageSize < 1 OR p_PageSize > 1000 THEN SET p_PageSize = 20; END IF;
    SET v_Offset = (p_Page - 1) * p_PageSize;
    IF p_WhereClause IS NOT NULL AND LENGTH(TRIM(p_WhereClause)) > 0 THEN
        SET v_FinalWhereClause = CONCAT('WHERE ', TRIM(p_WhereClause));
    ELSE
        SET v_FinalWhereClause = 'WHERE 1=1';
    END IF;
    
    SET @countSql = CONCAT(
        'SELECT COUNT(*) INTO @totalCount FROM inv_transaction ',
        v_FinalWhereClause
    );
    PREPARE countStmt FROM @countSql;
    EXECUTE countStmt;
    DEALLOCATE PREPARE countStmt;
    SET v_Count = @totalCount;
    
    
    SET @sql = CONCAT(
        'SELECT ID, TransactionType, BatchNumber, PartID, FromLocation, ToLocation, ',
        'Operation, Quantity, Notes, User, ItemType, ReceiveDate ',
        'FROM inv_transaction ',
        v_FinalWhereClause, ' ',
        'ORDER BY ReceiveDate DESC ',
        'LIMIT ', v_Offset, ', ', p_PageSize
    );
    PREPARE stmt FROM @sql;
    EXECUTE stmt;
    DEALLOCATE PREPARE stmt;
    
    IF v_Count > 0 THEN
        SET p_Status = 1;
        SET p_ErrorMsg = CONCAT('Found ', v_Count, ' transaction(s) matching criteria');
    ELSE
        SET p_Status = 0;
        SET p_ErrorMsg = 'No transactions found matching search criteria';
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `inv_transaction_Add` (IN `p_TransactionType` ENUM('IN','OUT','TRANSFER'), IN `p_PartID` VARCHAR(300), IN `p_BatchNumber` VARCHAR(100), IN `p_FromLocation` VARCHAR(300), IN `p_ToLocation` VARCHAR(300), IN `p_Operation` VARCHAR(100), IN `p_Quantity` INT, IN `p_Notes` VARCHAR(1000), IN `p_User` VARCHAR(100), IN `p_ItemType` VARCHAR(100), IN `p_ReceiveDate` DATETIME, IN `p_ColorCode` VARCHAR(50), IN `p_WorkOrder` VARCHAR(10), OUT `p_Status` INT, OUT `p_ErrorMsg` VARCHAR(500))   BEGIN
