CREATE DEFINER=`root`@`localhost` PROCEDURE `inv_transaction_Delete_ByID` (IN `p_ID` INT, OUT `p_Status` INT, OUT `p_ErrorMsg` VARCHAR(500))   BEGIN
    DECLARE v_RowsAffected INT DEFAULT 0;
    DECLARE v_ErrorMessage TEXT DEFAULT '';
    DECLARE v_TransactionExists INT DEFAULT 0;
    
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
        GET DIAGNOSTICS CONDITION 1 v_ErrorMessage = MESSAGE_TEXT;
        SET p_Status = -1;
        SET p_ErrorMsg = CONCAT('Database error occurred while deleting transaction ID: ', p_ID, ' - ', v_ErrorMessage);
    END;

    -- Validate input
    IF p_ID IS NULL OR p_ID <= 0 THEN
        SET p_Status = -2;
        SET p_ErrorMsg = 'Invalid transaction ID provided';
    ELSE
        -- Check if transaction exists
        SELECT COUNT(*) INTO v_TransactionExists 
        FROM inv_transaction 
        WHERE ID = p_ID;
        
        IF v_TransactionExists = 0 THEN
            SET p_Status = -3;
            SET p_ErrorMsg = CONCAT('Transaction ID ', p_ID, ' not found');
        ELSE
            -- Delete the transaction
            DELETE FROM inv_transaction 
            WHERE ID = p_ID;
            
            SET v_RowsAffected = ROW_COUNT();
            
            IF v_RowsAffected > 0 THEN
                SET p_Status = 1;
                SET p_ErrorMsg = CONCAT('Transaction ID ', p_ID, ' deleted successfully');
            ELSE
                SET p_Status = -4;
                SET p_ErrorMsg = CONCAT('Failed to delete transaction ID ', p_ID);
            END IF;
        END IF;
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `inv_transaction_Fix_Duplicates_Analysis` (IN `p_DryRun` BOOLEAN, IN `p_DeleteDuplicates` BOOLEAN, OUT `p_Status` INT, OUT `p_ErrorMsg` VARCHAR(500))   BEGIN
    DECLARE v_DuplicateGroups INT DEFAULT 0;
    DECLARE v_TotalDuplicates INT DEFAULT 0;
    DECLARE v_DuplicatesDeleted INT DEFAULT 0;
    
    
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
        ROLLBACK;
        GET DIAGNOSTICS CONDITION 1
            p_ErrorMsg = MESSAGE_TEXT;
        SET p_Status = -1;
    END;
    
    
    START TRANSACTION;
    
    
    DROP TEMPORARY TABLE IF EXISTS temp_duplicates;
    CREATE TEMPORARY TABLE temp_duplicates (
        ID INT PRIMARY KEY,
        BatchNumber VARCHAR(50),
        PartID VARCHAR(100),
        TransactionType VARCHAR(50),
        FromLocation VARCHAR(100),
        ToLocation VARCHAR(100),
        Operation VARCHAR(100),
        Quantity INT,
        User VARCHAR(100),
        ReceiveDate DATETIME,
        MinIDInGroup INT,
        IsKeep BOOLEAN DEFAULT FALSE,
        INDEX idx_group (BatchNumber, PartID, TransactionType, FromLocation, ToLocation, Operation, Quantity, User, ReceiveDate)
    );
    
    
                                  ToLocation, Operation, Quantity, User, ReceiveDate)
    SELECT 
        t.ID,
        t.BatchNumber,
        t.PartID,
        t.TransactionType,
        t.FromLocation,
        t.ToLocation,
        t.Operation,
        t.Quantity,
        t.User,
        t.ReceiveDate
    FROM inv_transaction t
    WHERE (t.BatchNumber, t.PartID, t.TransactionType, 
           COALESCE(t.FromLocation, ''), COALESCE(t.ToLocation, ''), 
           t.Operation, t.Quantity, t.User, t.ReceiveDate) IN (
        SELECT BatchNumber, PartID, TransactionType, 
               COALESCE(FromLocation, ''), COALESCE(ToLocation, ''), 
               Operation, Quantity, User, ReceiveDate
        FROM inv_transaction
        GROUP BY BatchNumber, PartID, TransactionType, 
                 COALESCE(FromLocation, ''), COALESCE(ToLocation, ''), 
                 Operation, Quantity, User, ReceiveDate
        HAVING COUNT(*) > 1
    );
    
    
    UPDATE temp_duplicates td
    INNER JOIN (
        SELECT 
            BatchNumber, PartID, TransactionType,
            COALESCE(FromLocation, '') AS FromLoc,
            COALESCE(ToLocation, '') AS ToLoc,
            Operation, Quantity, User, ReceiveDate,
            MIN(ID) AS MinID
        FROM temp_duplicates
        GROUP BY BatchNumber, PartID, TransactionType,
                 COALESCE(FromLocation, ''), COALESCE(ToLocation, ''),
                 Operation, Quantity, User, ReceiveDate
    ) grp ON td.BatchNumber = grp.BatchNumber
         AND td.PartID = grp.PartID
         AND td.TransactionType = grp.TransactionType
         AND COALESCE(td.FromLocation, '') = grp.FromLoc
         AND COALESCE(td.ToLocation, '') = grp.ToLoc
         AND td.Operation = grp.Operation
         AND td.Quantity = grp.Quantity
         AND td.User = grp.User
         AND td.ReceiveDate = grp.ReceiveDate
    SET td.MinIDInGroup = grp.MinID;
    
    
    UPDATE temp_duplicates
    SET IsKeep = TRUE
    WHERE ID = MinIDInGroup;
    
    
    SELECT COUNT(*) INTO v_TotalDuplicates FROM temp_duplicates;
    SELECT COUNT(DISTINCT MinIDInGroup) INTO v_DuplicateGroups FROM temp_duplicates;
    
    IF p_DryRun THEN
        
        SELECT 
            'DUPLICATE_ANALYSIS' AS Report_Type,
            v_DuplicateGroups AS Total_Duplicate_Groups,
            v_TotalDuplicates AS Total_Duplicate_Records,
            (v_TotalDuplicates - v_DuplicateGroups) AS Records_To_Delete;
        
        
        SELECT 
            'SAMPLE_DUPLICATES' AS Sample_Type,
            BatchNumber,
            PartID,
            TransactionType,
            FromLocation,
            ToLocation,
            Quantity,
            User,
            ReceiveDate,
            COUNT(*) AS Duplicate_Count,
            GROUP_CONCAT(ID ORDER BY ID) AS Duplicate_IDs,
            MIN(CASE WHEN IsKeep THEN ID END) AS ID_To_Keep,
            GROUP_CONCAT(CASE WHEN NOT IsKeep THEN ID END ORDER BY ID) AS IDs_To_Delete
        FROM temp_duplicates
        GROUP BY BatchNumber, PartID, TransactionType, FromLocation, ToLocation, 
                 Operation, Quantity, User, ReceiveDate
        ORDER BY COUNT(*) DESC
        LIMIT 20;
        
        
        SELECT 
            'BATCHES_TO_FIX' AS Report_Type,
            t.BatchNumber,
            t.PartID,
            SUM(CASE WHEN t.TransactionType = 'IN' AND td.IsKeep THEN t.Quantity ELSE 0 END) AS Current_IN_Total,
            SUM(CASE WHEN t.TransactionType = 'OUT' AND td.IsKeep THEN t.Quantity ELSE 0 END) AS Current_OUT_Total,
            SUM(CASE WHEN t.TransactionType = 'IN' THEN t.Quantity ELSE 0 END) AS Before_Fix_IN_Total,
            SUM(CASE WHEN t.TransactionType = 'OUT' THEN t.Quantity ELSE 0 END) AS Before_Fix_OUT_Total,
            (SUM(CASE WHEN t.TransactionType = 'OUT' THEN t.Quantity ELSE 0 END) - 
             SUM(CASE WHEN t.TransactionType = 'OUT' AND td.IsKeep THEN t.Quantity ELSE 0 END)) AS Excess_OUT_Removed
        FROM inv_transaction t
        INNER JOIN temp_duplicates td ON t.ID = td.ID
        GROUP BY t.BatchNumber, t.PartID
        HAVING Excess_OUT_Removed > 0
        ORDER BY Excess_OUT_Removed DESC
        LIMIT 20;
        
        ROLLBACK;
        SET p_Status = 0;
        SET p_ErrorMsg = CONCAT('DRY RUN: Found ', v_DuplicateGroups, ' duplicate groups containing ', 
                                v_TotalDuplicates, ' records. Would delete ', 
                                (v_TotalDuplicates - v_DuplicateGroups), ' duplicate records.');
        
    ELSE
        
        CREATE TABLE IF NOT EXISTS inv_transaction_duplicates_backup_20251103 (
            ID INT PRIMARY KEY,
            TransactionType VARCHAR(50),
            BatchNumber VARCHAR(50),
            PartID VARCHAR(100),
            FromLocation VARCHAR(100),
            ToLocation VARCHAR(100),
            Operation VARCHAR(100),
            Quantity INT,
            Notes VARCHAR(1000),
            User VARCHAR(100),
            ItemType VARCHAR(200),
            ReceiveDate DATETIME,
            backup_date DATETIME DEFAULT CURRENT_TIMESTAMP,
            deletion_reason VARCHAR(255),
            INDEX idx_batch_part (BatchNumber, PartID)
        ) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;
        
        IF p_DeleteDuplicates THEN
            
                 Quantity, Notes, User, ItemType, ReceiveDate, deletion_reason)
            SELECT 
                t.ID, t.TransactionType, t.BatchNumber, t.PartID, t.FromLocation, t.ToLocation,
                t.Operation, t.Quantity, t.Notes, t.User, t.ItemType, t.ReceiveDate,
                CONCAT('Duplicate of ID ', td.ID, ' (kept)')
            FROM inv_transaction t
            INNER JOIN temp_duplicates td ON t.ID = td.ID
            WHERE td.IsKeep = FALSE;
            
            
            DELETE t FROM inv_transaction t
            INNER JOIN temp_duplicates td ON t.ID = td.ID
            WHERE td.IsKeep = FALSE;
            
            SET v_DuplicatesDeleted = ROW_COUNT();
            
            COMMIT;
            
            SET p_Status = 1;
            SET p_ErrorMsg = CONCAT(
                'SUCCESS: Deleted ', v_DuplicatesDeleted, ' duplicate records from ', 
                v_DuplicateGroups, ' duplicate groups. ',
                'Backup table: inv_transaction_duplicates_backup_20251103'
            );
            
            
            SELECT 
                'DELETION_COMPLETE' AS Status,
                v_DuplicateGroups AS Duplicate_Groups_Fixed,
                v_DuplicatesDeleted AS Records_Deleted,
                'inv_transaction_duplicates_backup_20251103' AS Backup_Table;
            
        ELSE
            
            ROLLBACK;
            SET p_Status = 0;
            SET p_ErrorMsg = CONCAT('ANALYSIS: Found ', v_DuplicateGroups, ' duplicate groups. ',
                                    'Run with p_DeleteDuplicates=TRUE to fix.');
        END IF;
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `inv_transaction_Fix_IN_ColumnSwap` (IN `p_DryRun` BOOLEAN, OUT `p_Status` INT, OUT `p_ErrorMsg` VARCHAR(500))   BEGIN
    DECLARE v_AffectedCount INT DEFAULT 0;
    DECLARE v_BeforeIncorrect INT DEFAULT 0;
    DECLARE v_AfterIncorrect INT DEFAULT 0;
    DECLARE v_AfterCorrect INT DEFAULT 0;
    
    
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
        ROLLBACK;
        GET DIAGNOSTICS CONDITION 1
            p_ErrorMsg = MESSAGE_TEXT;
        SET p_Status = -1;
    END;
    
    
    START TRANSACTION;
    
    
    SELECT COUNT(*) INTO v_BeforeIncorrect
    FROM inv_transaction
    WHERE TransactionType = 'IN'
      AND FromLocation IS NOT NULL
      AND ToLocation IS NULL;
    
    
    CREATE TABLE IF NOT EXISTS inv_transaction_rollback_20251103 (
        ID INT PRIMARY KEY,
        TransactionType VARCHAR(50),
        BatchNumber VARCHAR(50),
        PartID VARCHAR(100),
        FromLocation VARCHAR(100),
        ToLocation VARCHAR(100),
        Operation VARCHAR(100),
        Quantity INT,
        Notes VARCHAR(1000),
        User VARCHAR(100),
        ItemType VARCHAR(200),
        ReceiveDate DATETIME,
        migration_backup_date DATETIME DEFAULT CURRENT_TIMESTAMP,
        INDEX idx_transaction_type (TransactionType),
        INDEX idx_batch_number (BatchNumber)
    ) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;
    
    
         Quantity, Notes, User, ItemType, ReceiveDate)
    SELECT 
        ID, TransactionType, BatchNumber, PartID, FromLocation, ToLocation, Operation,
        Quantity, Notes, User, ItemType, ReceiveDate
    FROM inv_transaction
    WHERE TransactionType = 'IN'
      AND FromLocation IS NOT NULL
      AND ToLocation IS NULL;
    
    
    SELECT CONCAT('Backed up ', ROW_COUNT(), ' records to rollback table') AS BackupStatus;
    
    IF p_DryRun THEN
        
        SELECT 
            'DRY_RUN_PREVIEW' AS Mode,
            ID,
            TransactionType,
            FromLocation AS 'Current_FromLocation_WRONG',
            ToLocation AS 'Current_ToLocation_WRONG',
            FromLocation AS 'Will_Become_ToLocation_CORRECT',
            NULL AS 'Will_Become_FromLocation_CORRECT',
            PartID,
            BatchNumber,
            ReceiveDate
        FROM inv_transaction
        WHERE TransactionType = 'IN'
          AND FromLocation IS NOT NULL
          AND ToLocation IS NULL
        ORDER BY ReceiveDate DESC
        LIMIT 20;
        
        
        ROLLBACK;
        
        SET p_Status = 0;
        SET p_ErrorMsg = CONCAT('DRY RUN: Would affect ', v_BeforeIncorrect, ' IN transactions. No changes made. Review preview results.');
        
    ELSE
        
        UPDATE inv_transaction
        SET
            ToLocation = FromLocation,    
            FromLocation = NULL           
        WHERE
            TransactionType = 'IN'
            AND FromLocation IS NOT NULL
            AND ToLocation IS NULL;
        
        SET v_AffectedCount = ROW_COUNT();
        
        
        SELECT COUNT(*) INTO v_AfterIncorrect
        FROM inv_transaction
        WHERE TransactionType = 'IN'
          AND FromLocation IS NOT NULL
          AND ToLocation IS NULL;
        
        SELECT COUNT(*) INTO v_AfterCorrect
        FROM inv_transaction
        WHERE TransactionType = 'IN'
          AND FromLocation IS NULL
          AND ToLocation IS NOT NULL;
        
        
        IF v_AfterIncorrect = 0 AND v_AfterCorrect = v_BeforeIncorrect THEN
            
            COMMIT;
            
            SET p_Status = 1;
            SET p_ErrorMsg = CONCAT(
                'SUCCESS: Migrated ', v_AffectedCount, ' IN transactions. ',
                'Before: ', v_BeforeIncorrect, ' incorrect. ',
                'After: ', v_AfterCorrect, ' correct, ', v_AfterIncorrect, ' incorrect. ',
                'Rollback table: inv_transaction_rollback_20251103'
            );
            
            
            SELECT 
                'MIGRATION_SUCCESS' AS Status,
                ID,
                TransactionType,
                FromLocation AS 'FromLocation_Now_NULL',
                ToLocation AS 'ToLocation_Now_Populated',
                PartID,
                BatchNumber,
                ReceiveDate
            FROM inv_transaction
            WHERE TransactionType = 'IN'
            ORDER BY ReceiveDate DESC
            LIMIT 10;
            
        ELSE
            
            ROLLBACK;
            
            SET p_Status = -2;
            SET p_ErrorMsg = CONCAT(
                'VALIDATION FAILED: Expected 0 incorrect after migration, got ', v_AfterIncorrect, '. ',
                'Expected ', v_BeforeIncorrect, ' correct, got ', v_AfterCorrect, '. ',
                'Transaction rolled back. No changes made.'
            );
        END IF;
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `log_changelog_Get_Current` (OUT `p_Status` INT, OUT `p_ErrorMsg` VARCHAR(500))   BEGIN
    DECLARE table_exists INT DEFAULT 0;
    DECLARE row_count INT DEFAULT 0;
    
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
        SET p_Status = -1;
        SET p_ErrorMsg = 'Database error occurred while retrieving current changelog';
    END;
    
    -- Check if log_changelog table exists
    SELECT COUNT(*)
    INTO table_exists
    FROM information_schema.TABLES
    WHERE TABLE_SCHEMA = DATABASE()
    AND TABLE_NAME = 'log_changelog';
    
    IF table_exists = 0 THEN
        -- Table doesn't exist yet - return empty result with status 0
        SET p_Status = 0;
        SET p_ErrorMsg = 'Changelog table does not exist yet';
        SELECT
            '0.0.0.0' AS Version,
            'No version information available' AS Notes,
            NULL AS Date
        LIMIT 0;
    ELSE
        -- Table exists - check for rows
        SELECT COUNT(*) INTO row_count FROM log_changelog;
        
        IF row_count = 0 THEN
            -- Table exists but no entries
            SET p_Status = 0;
            SET p_ErrorMsg = 'No changelog entries found';
            SELECT
                '0.0.0.0' AS Version,
                'No version information available' AS Notes,
                NULL AS Date
            LIMIT 0;
        ELSE
            -- Return most recent changelog entry
            -- Note: Table doesn't have Date column, so we just return the first row
            SELECT
                Version,
                Notes,
                NULL AS Date
            FROM log_changelog
            LIMIT 1;
            SET p_Status = 1;
            SET p_ErrorMsg = 'Retrieved current changelog version';
        END IF;
    END IF;
END$$

