CREATE DEFINER=`root`@`localhost` PROCEDURE `maint_reload_part_ids_and_operation_numbers` (OUT `p_Status` INT, OUT `p_ErrorMsg` VARCHAR(500))   BEGIN
    -- Transaction management removed: Works within caller's transaction context (tests use transactions)`r`n    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
        GET DIAGNOSTICS CONDITION 1
            p_ErrorMsg = MESSAGE_TEXT;
        SET p_Status = -1;
    END;
    TRUNCATE TABLE mtm_wip_application.md_part_ids;
        `PartID`,
        `Operations`,
        `Customer`,
        `Description`,
        `IssuedBy`,
        `ItemType`
    )
    SELECT
        seqs.ID AS `PartID`,
        CAST(seqs.sequence_array AS JSON) AS `Operations`,
        '' AS `Customer`,
        descs.Description AS `Description`,
        '[ System ]' AS `IssuedBy`,
        'WIP' AS `ItemType`
    FROM (
        SELECT
            ID,
            CONCAT('[', GROUP_CONCAT(DISTINCT SEQUENCE_NO ORDER BY SEQUENCE_NO), ']') AS sequence_array
        FROM
            `mtm database`.part_requirement
        GROUP BY
            ID
    ) seqs
    LEFT JOIN (
        SELECT
            ID,
            MIN(Description) AS Description
        FROM
            `mtm database`.part_requirement
        WHERE
            Description IS NOT NULL AND Description <> ''
        GROUP BY
            ID
    ) descs
    ON seqs.ID = descs.ID;
    SELECT DISTINCT op_num
    FROM (
        SELECT
            TRIM(BOTH '"' FROM
                JSON_UNQUOTE(
                    JSON_EXTRACT(mpi.Operations, CONCAT('$[', n.n, ']'))
                )
            ) AS op_num
        FROM
            mtm_wip_application.md_part_ids mpi
        JOIN (
            SELECT 0 AS n UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL
            SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL
            SELECT 8 UNION ALL SELECT 9 UNION ALL SELECT 10 UNION ALL SELECT 11 UNION ALL
            SELECT 12 UNION ALL SELECT 13 UNION ALL SELECT 14 UNION ALL SELECT 15
        ) n
        ON n.n < JSON_LENGTH(mpi.Operations)
        WHERE mpi.Operations IS NOT NULL
    ) AS all_ops
    WHERE op_num IS NOT NULL AND op_num <> '';
    SET p_Status = 1;
    SET p_ErrorMsg = 'Part IDs and operation numbers reloaded successfully';
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `maint_transactions_FindDuplicates` (IN `p_DuplicateType` VARCHAR(50), OUT `p_Status` INT, OUT `p_ErrorMsg` VARCHAR(500))   BEGIN
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
        GET DIAGNOSTICS CONDITION 1
            @sqlstate = RETURNED_SQLSTATE,
            @errno = MYSQL_ERRNO,
            @text = MESSAGE_TEXT;
        SET p_Status = -1;
        SET p_ErrorMsg = CONCAT('Database error: ', @text);
    END;
    
    
    IF p_DuplicateType IS NULL OR p_DuplicateType = '' THEN
        SET p_Status = -2;
        SET p_ErrorMsg = 'DuplicateType is required (EXACT, SAME_TIMESTAMP, or ALL)';
        SELECT p_Status AS Status, p_ErrorMsg AS ErrorMsg;
    ELSEIF p_DuplicateType NOT IN ('EXACT', 'SAME_TIMESTAMP', 'ALL') THEN
        SET p_Status = -2;
        SET p_ErrorMsg = 'Invalid DuplicateType. Must be EXACT, SAME_TIMESTAMP, or ALL';
        SELECT p_Status AS Status, p_ErrorMsg AS ErrorMsg;
    ELSE
        
        IF p_DuplicateType = 'EXACT' THEN
            
            SELECT 
                'EXACT_DUPLICATE' AS DuplicateType,
                t.ID,
                t.BatchNumber,
                t.PartID,
                t.TransactionType,
                t.FromLocation,
                t.ToLocation,
                t.Operation,
                t.Quantity,
                t.User,
                t.ReceiveDate,
                t.ItemType,
                t.Notes,
                (SELECT MIN(t2.ID) 
                 FROM inv_transaction t2
                 WHERE t2.BatchNumber <=> t.BatchNumber
                 AND t2.PartID = t.PartID
                 AND t2.TransactionType = t.TransactionType
                 AND COALESCE(t2.FromLocation, '') = COALESCE(t.FromLocation, '')
                 AND COALESCE(t2.ToLocation, '') = COALESCE(t.ToLocation, '')
                 AND t2.Operation = t.Operation
                 AND t2.Quantity = t.Quantity
                 AND t2.User = t.User
                 AND t2.ReceiveDate = t.ReceiveDate
                ) AS MinID_ToKeep,
                'DELETE' AS Action
            FROM inv_transaction t
            WHERE EXISTS (
                SELECT 1 FROM inv_transaction t2
                WHERE t2.ID < t.ID
                AND t2.BatchNumber <=> t.BatchNumber
                AND t2.PartID = t.PartID
                AND t2.TransactionType = t.TransactionType
                AND COALESCE(t2.FromLocation, '') = COALESCE(t.FromLocation, '')
                AND COALESCE(t2.ToLocation, '') = COALESCE(t.ToLocation, '')
                AND t2.Operation = t.Operation
                AND t2.Quantity = t.Quantity
                AND t2.User = t.User
                AND t2.ReceiveDate = t.ReceiveDate
            )
            ORDER BY t.BatchNumber, t.ID;
            
        ELSEIF p_DuplicateType = 'SAME_TIMESTAMP' THEN
            
            SELECT 
                'SAME_TIMESTAMP_OUT' AS DuplicateType,
                t1.ID,
                t1.BatchNumber,
                t1.PartID,
                t1.TransactionType,
                t1.FromLocation,
                t1.ToLocation,
                t1.Operation,
                t1.Quantity,
                t1.User,
                t1.ReceiveDate,
                t1.ItemType,
                t1.Notes,
                (SELECT t2.ID 
                 FROM inv_transaction t2
                 WHERE t2.BatchNumber = t1.BatchNumber
                 AND t2.TransactionType = 'IN'
                 AND t2.ReceiveDate = t1.ReceiveDate
                 LIMIT 1
                ) AS Matching_IN_ID,
                'DELETE' AS Action
            FROM inv_transaction t1
            WHERE t1.TransactionType = 'OUT'
            AND EXISTS (
                SELECT 1 FROM inv_transaction t2
                WHERE t2.BatchNumber = t1.BatchNumber
                AND t2.TransactionType = 'IN'
                AND t2.ReceiveDate = t1.ReceiveDate
            )
            ORDER BY t1.BatchNumber, t1.ID;
            
        ELSE 
            
            
            
            DROP TEMPORARY TABLE IF EXISTS temp_all_duplicates;
            CREATE TEMPORARY TABLE temp_all_duplicates (
                DuplicateType VARCHAR(50),
                ID BIGINT,
                BatchNumber VARCHAR(20),
                PartID VARCHAR(100),
                TransactionType VARCHAR(20),
                FromLocation VARCHAR(100),
                ToLocation VARCHAR(100),
                Operation VARCHAR(100),
                Quantity INT,
                User VARCHAR(100),
                ReceiveDate DATETIME,
                ItemType VARCHAR(200),
                Notes VARCHAR(1000),
                Reference_ID BIGINT,
                Action VARCHAR(20)
            );
            
            
            SELECT 
                'EXACT_DUPLICATE' AS DuplicateType,
                t.ID,
                t.BatchNumber,
                t.PartID,
                t.TransactionType,
                t.FromLocation,
                t.ToLocation,
                t.Operation,
                t.Quantity,
                t.User,
                t.ReceiveDate,
                t.ItemType,
                t.Notes,
                (SELECT MIN(t2.ID) 
                 FROM inv_transaction t2
                 WHERE t2.BatchNumber <=> t.BatchNumber
                 AND t2.PartID = t.PartID
                 AND t2.TransactionType = t.TransactionType
                 AND COALESCE(t2.FromLocation, '') = COALESCE(t.FromLocation, '')
                 AND COALESCE(t2.ToLocation, '') = COALESCE(t.ToLocation, '')
                 AND t2.Operation = t.Operation
                 AND t2.Quantity = t.Quantity
                 AND t2.User = t.User
                 AND t2.ReceiveDate = t.ReceiveDate
                ) AS Reference_ID,
                'DELETE' AS Action
            FROM inv_transaction t
            WHERE EXISTS (
                SELECT 1 FROM inv_transaction t2
                WHERE t2.ID < t.ID
                AND t2.BatchNumber <=> t.BatchNumber
                AND t2.PartID = t.PartID
                AND t2.TransactionType = t.TransactionType
                AND COALESCE(t2.FromLocation, '') = COALESCE(t.FromLocation, '')
                AND COALESCE(t2.ToLocation, '') = COALESCE(t.ToLocation, '')
                AND t2.Operation = t.Operation
                AND t2.Quantity = t.Quantity
                AND t2.User = t.User
                AND t2.ReceiveDate = t.ReceiveDate
            );
            
            
            SELECT 
                'SAME_TIMESTAMP_OUT' AS DuplicateType,
                t1.ID,
                t1.BatchNumber,
                t1.PartID,
                t1.TransactionType,
                t1.FromLocation,
                t1.ToLocation,
                t1.Operation,
                t1.Quantity,
                t1.User,
                t1.ReceiveDate,
                t1.ItemType,
                t1.Notes,
                (SELECT t2.ID 
                 FROM inv_transaction t2
                 WHERE t2.BatchNumber = t1.BatchNumber
                 AND t2.TransactionType = 'IN'
                 AND t2.ReceiveDate = t1.ReceiveDate
                 LIMIT 1
                ) AS Reference_ID,
                'DELETE' AS Action
            FROM inv_transaction t1
            WHERE t1.TransactionType = 'OUT'
            AND EXISTS (
                SELECT 1 FROM inv_transaction t2
                WHERE t2.BatchNumber = t1.BatchNumber
                AND t2.TransactionType = 'IN'
                AND t2.ReceiveDate = t1.ReceiveDate
            );
            
            
            SELECT * FROM temp_all_duplicates
            ORDER BY DuplicateType, BatchNumber, ID;
            
            DROP TEMPORARY TABLE IF EXISTS temp_all_duplicates;
        END IF;
        
        SET p_Status = 1;
        SET p_ErrorMsg = CONCAT('Found duplicates of type: ', p_DuplicateType);
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `maint_transactions_RemoveDuplicates` (IN `p_DuplicateType` VARCHAR(50), IN `p_CreateBackup` BOOLEAN, OUT `p_Status` INT, OUT `p_ErrorMsg` VARCHAR(500))   BEGIN
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    DECLARE v_DeletedCount INT DEFAULT 0;
    DECLARE v_BackupTableName VARCHAR(100);
    
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
        GET DIAGNOSTICS CONDITION 1
            @sqlstate = RETURNED_SQLSTATE,
            @errno = MYSQL_ERRNO,
            @text = MESSAGE_TEXT;
        SET p_Status = -1;
        SET p_ErrorMsg = CONCAT('Database error: ', @text);
        ROLLBACK;
    END;
    
    
    IF p_DuplicateType IS NULL OR p_DuplicateType = '' THEN
        SET p_Status = -2;
        SET p_ErrorMsg = 'DuplicateType is required (EXACT, SAME_TIMESTAMP, or ALL)';
    ELSEIF p_DuplicateType NOT IN ('EXACT', 'SAME_TIMESTAMP', 'ALL') THEN
        SET p_Status = -2;
        SET p_ErrorMsg = 'Invalid DuplicateType. Must be EXACT, SAME_TIMESTAMP, or ALL';
    ELSE
        
        START TRANSACTION;
        
        
        IF p_CreateBackup THEN
            SET v_BackupTableName = CONCAT('inv_transaction_backup_', 
                                           LOWER(p_DuplicateType), '_',
                                           DATE_FORMAT(NOW(), '%Y%m%d_%H%i%s'));
            
            SET @sql = CONCAT('DROP TABLE IF EXISTS ', v_BackupTableName);
            PREPARE stmt FROM @sql;
            EXECUTE stmt;
            DEALLOCATE PREPARE stmt;
            
            SET @sql = CONCAT('CREATE TABLE ', v_BackupTableName, ' LIKE inv_transaction');
            PREPARE stmt FROM @sql;
            EXECUTE stmt;
            DEALLOCATE PREPARE stmt;
        END IF;
        
        
        IF p_DuplicateType = 'EXACT' THEN
            
            IF p_CreateBackup THEN
                SET @sql = CONCAT(
                    'INSERT INTO ', v_BackupTableName, ' ',
                    'SELECT t.* FROM inv_transaction t ',
                    'WHERE EXISTS (',
                    '    SELECT 1 FROM inv_transaction t2 ',
                    '    WHERE t2.ID < t.ID ',
                    '    AND t2.BatchNumber <=> t.BatchNumber ',
                    '    AND t2.PartID = t.PartID ',
                    '    AND t2.TransactionType = t.TransactionType ',
                    '    AND COALESCE(t2.FromLocation, '''') = COALESCE(t.FromLocation, '''') ',
                    '    AND COALESCE(t2.ToLocation, '''') = COALESCE(t.ToLocation, '''') ',
                    '    AND t2.Operation = t.Operation ',
                    '    AND t2.Quantity = t.Quantity ',
                    '    AND t2.User = t.User ',
                    '    AND t2.ReceiveDate = t.ReceiveDate',
                    ')'
                );
                PREPARE stmt FROM @sql;
                EXECUTE stmt;
                DEALLOCATE PREPARE stmt;
            END IF;
            
            
            DROP TEMPORARY TABLE IF EXISTS temp_ids_to_delete;
            CREATE TEMPORARY TABLE temp_ids_to_delete AS
            SELECT t.ID
            FROM inv_transaction t
            WHERE EXISTS (
                SELECT 1 FROM inv_transaction t2
                WHERE t2.ID < t.ID
                AND t2.BatchNumber <=> t.BatchNumber
                AND t2.PartID = t.PartID
                AND t2.TransactionType = t.TransactionType
                AND COALESCE(t2.FromLocation, '') = COALESCE(t.FromLocation, '')
                AND COALESCE(t2.ToLocation, '') = COALESCE(t.ToLocation, '')
                AND t2.Operation = t.Operation
                AND t2.Quantity = t.Quantity
                AND t2.User = t.User
                AND t2.ReceiveDate = t.ReceiveDate
            );
            
            
            DELETE FROM inv_transaction
            WHERE ID IN (SELECT ID FROM temp_ids_to_delete);
            
            SET v_DeletedCount = ROW_COUNT();
            DROP TEMPORARY TABLE IF EXISTS temp_ids_to_delete;
            
        ELSEIF p_DuplicateType = 'SAME_TIMESTAMP' THEN
            
            IF p_CreateBackup THEN
                SET @sql = CONCAT(
                    'INSERT INTO ', v_BackupTableName, ' ',
                    'SELECT t1.* FROM inv_transaction t1 ',
                    'WHERE t1.TransactionType = ''OUT'' ',
                    'AND EXISTS (',
                    '    SELECT 1 FROM inv_transaction t2 ',
                    '    WHERE t2.BatchNumber = t1.BatchNumber ',
                    '    AND t2.TransactionType = ''IN'' ',
                    '    AND t2.ReceiveDate = t1.ReceiveDate',
                    ')'
                );
                PREPARE stmt FROM @sql;
                EXECUTE stmt;
                DEALLOCATE PREPARE stmt;
            END IF;
            
            
            DROP TEMPORARY TABLE IF EXISTS temp_ids_to_delete;
            CREATE TEMPORARY TABLE temp_ids_to_delete AS
            SELECT t1.ID
            FROM inv_transaction t1
            WHERE t1.TransactionType = 'OUT'
            AND EXISTS (
                SELECT 1 FROM inv_transaction t2
                WHERE t2.BatchNumber = t1.BatchNumber
                AND t2.TransactionType = 'IN'
                AND t2.ReceiveDate = t1.ReceiveDate
            );
            
            
            DELETE FROM inv_transaction
            WHERE ID IN (SELECT ID FROM temp_ids_to_delete);
            
            SET v_DeletedCount = ROW_COUNT();
            DROP TEMPORARY TABLE IF EXISTS temp_ids_to_delete;
            
        ELSE 
            
            IF p_CreateBackup THEN
                
                SET @sql = CONCAT(
                    'INSERT INTO ', v_BackupTableName, ' ',
                    'SELECT t.* FROM inv_transaction t ',
                    'WHERE EXISTS (',
                    '    SELECT 1 FROM inv_transaction t2 ',
                    '    WHERE t2.ID < t.ID ',
                    '    AND t2.BatchNumber <=> t.BatchNumber ',
                    '    AND t2.PartID = t.PartID ',
                    '    AND t2.TransactionType = t.TransactionType ',
