CREATE DEFINER=`root`@`localhost` PROCEDURE `md_color_codes_Add` (IN `p_ColorCode` VARCHAR(50), OUT `p_Status` INT, OUT `p_ErrorMsg` VARCHAR(500))   BEGIN
    DECLARE color_exists INT DEFAULT 0;
    
    
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
        SET p_Status = -1;
        SET p_ErrorMsg = 'Error adding color code';
        ROLLBACK;
    END;

    
    IF p_ColorCode IS NULL OR p_ColorCode = '' THEN
        SET p_Status = -2;
        SET p_ErrorMsg = 'ColorCode is required';
    ELSE
        
        IF p_ColorCode IN ('Unknown', 'Other') THEN
            SET p_Status = -3;
            SET p_ErrorMsg = 'Cannot add reserved color codes';
        ELSE
            START TRANSACTION;

            
            SELECT COUNT(*) INTO color_exists
            FROM md_color_codes
            WHERE ColorCode = p_ColorCode;

            IF color_exists > 0 THEN
                
                SET p_Status = 0;
                SET p_ErrorMsg = NULL;
                COMMIT;
            ELSE
                
                VALUES (p_ColorCode, TRUE, NOW());

                SET p_Status = 1;
                SET p_ErrorMsg = NULL;
                COMMIT;
            END IF;
        END IF;
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `md_color_codes_GetAll` (OUT `p_Status` INT, OUT `p_ErrorMsg` VARCHAR(500))   BEGIN
    
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
        SET p_Status = -1;
        SET p_ErrorMsg = 'Error retrieving color codes';
        ROLLBACK;
    END;

    
    START TRANSACTION;

    
    SELECT 
        ColorCode,
        IsUserDefined,
        CreatedDate
    FROM md_color_codes
    WHERE ColorCode != 'Other'  
    ORDER BY ColorCode ASC;

    
    IF FOUND_ROWS() > 0 THEN
        SET p_Status = 1;  
        SET p_ErrorMsg = NULL;
    ELSE
        SET p_Status = 0;  
        SET p_ErrorMsg = 'No color codes found';
    END IF;

    COMMIT;
END$$

