    IF p_UserName IS NULL OR TRIM(p_UserName) = '' THEN
        SET p_Status = -2;
        SET p_ErrorMsg = 'UserName is required';
        SET p_ReportID = NULL;
    ELSE
        START TRANSACTION;
        
        -- Insert error report
            ReportDate,
            UserName,
            MachineName,
            AppVersion,
            ErrorType,
            ErrorSummary,
            UserNotes,
            TechnicalDetails,
            CallStack,
            Status
        ) VALUES (
            NOW(),
            p_UserName,
            p_MachineName,
            p_AppVersion,
            p_ErrorType,
            p_ErrorSummary,
            p_UserNotes,
            p_TechnicalDetails,
            p_CallStack,
            'New'
        );
        
        -- Get the generated ReportID
        SET p_ReportID = LAST_INSERT_ID();
        
        -- Success
        SET p_Status = 0;
        SET p_ErrorMsg = 'Error report inserted successfully';
        
        COMMIT;
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_error_reports_UpdateStatus` (IN `p_ReportID` INT, IN `p_NewStatus` VARCHAR(20), IN `p_DeveloperNotes` TEXT, IN `p_ReviewedBy` VARCHAR(100), IN `p_ReviewedDate` DATETIME, OUT `p_Status` INT, OUT `p_ErrorMsg` VARCHAR(500))   proc:BEGIN
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
        ROLLBACK;
        GET DIAGNOSTICS CONDITION 1 p_ErrorMsg = MESSAGE_TEXT;
        IF p_ErrorMsg IS NULL OR p_ErrorMsg = '' THEN
            SET p_ErrorMsg = 'Database error occurred while updating error report status';
        END IF;
        SET p_Status = -1;
    END;

    -- Validate new status value
    IF p_NewStatus NOT IN ('New', 'Reviewed', 'Resolved') THEN
        SET p_Status = -3;
        SET p_ErrorMsg = 'Invalid status value. Must be: New, Reviewed, or Resolved';
        LEAVE proc;
    END IF;

    -- Ensure report exists before attempting update
    IF NOT EXISTS (SELECT 1 FROM error_reports WHERE ReportID = p_ReportID) THEN
        SET p_Status = -2;
        SET p_ErrorMsg = 'ReportID not found';
        LEAVE proc;
    END IF;

    START TRANSACTION;

    UPDATE error_reports
    SET
        Status = p_NewStatus,
        ReviewedBy = p_ReviewedBy,
        ReviewedDate = p_ReviewedDate,
        DeveloperNotes = CASE
            WHEN p_DeveloperNotes IS NULL THEN DeveloperNotes
            ELSE p_DeveloperNotes
        END
    WHERE ReportID = p_ReportID;

    COMMIT;

    SET p_Status = 0;
    SET p_ErrorMsg = 'Error report status updated successfully';
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_ReassignBatchNumbers` (OUT `p_Status` INT, OUT `p_ErrorMsg` VARCHAR(500))   BEGIN
    DECLARE done INT DEFAULT 0;
    DECLARE curINID BIGINT;
    DECLARE curPartID VARCHAR(50);
    DECLARE curINDate DATETIME;
    DECLARE curQty DECIMAL(18,4);
    DECLARE curFromLocation VARCHAR(50);
    DECLARE curToLocation VARCHAR(50);
    DECLARE newBatch BIGINT;
    DECLARE batch_str VARCHAR(20);
    DECLARE curOtherID BIGINT;
    DECLARE curOtherPartID VARCHAR(50);
    DECLARE v_ProcessedCount INT DEFAULT 0;
    DECLARE in_cursor CURSOR FOR
        SELECT ID, PartID, ReceiveDate, Quantity, FromLocation, ToLocation
        FROM mtm_wip_application.inv_transaction
        WHERE TransactionType = 'IN' AND BatchNumber IS NULL
        ORDER BY PartID, ReceiveDate;
    DECLARE other_cursor CURSOR FOR
        SELECT ID, PartID
        FROM mtm_wip_application.inv_transaction
        WHERE TransactionType IN ('TRANSFER', 'OUT') AND BatchNumber IS NULL
        ORDER BY PartID;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;
    -- Transaction management removed: Works within caller's transaction context (tests use transactions)`r`n    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
        GET DIAGNOSTICS CONDITION 1
            p_ErrorMsg = MESSAGE_TEXT;
        SET p_Status = -1;
    END;
    SELECT last_batch_number INTO newBatch FROM mtm_wip_application.inv_inventory_batch_seq;
    OPEN in_cursor;
    in_loop: LOOP
        FETCH in_cursor INTO curINID, curPartID, curINDate, curQty, curFromLocation, curToLocation;
        IF done THEN
            LEAVE in_loop;
        END IF;
        SET newBatch = newBatch + 1;
        SET batch_str = LPAD(newBatch, 10, '0');
        UPDATE mtm_wip_application.inv_transaction
        SET BatchNumber = batch_str
        WHERE ID = curINID;
        SET v_ProcessedCount = v_ProcessedCount + 1;
    END LOOP;
    CLOSE in_cursor;
    SET done = 0;
    OPEN other_cursor;
    other_loop: LOOP
        FETCH other_cursor INTO curOtherID, curOtherPartID;
        IF done THEN
            LEAVE other_loop;
        END IF;
        SET newBatch = newBatch + 1;
        SET batch_str = LPAD(newBatch, 10, '0');
        UPDATE mtm_wip_application.inv_transaction
        SET BatchNumber = batch_str
        WHERE ID = curOtherID;
        SET v_ProcessedCount = v_ProcessedCount + 1;
    END LOOP;
    CLOSE other_cursor;
    UPDATE mtm_wip_application.inv_inventory_batch_seq
    SET last_batch_number = newBatch;
    IF v_ProcessedCount > 0 THEN
        SET p_Status = 1;
        SET p_ErrorMsg = CONCAT('Reassigned ', v_ProcessedCount, ' batch number(s)');
    ELSE
        SET p_Status = 0;
        SET p_ErrorMsg = 'No batch numbers needed reassignment';
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sys_GetRoleIdByName` (IN `p_RoleName` VARCHAR(100), OUT `p_Status` INT, OUT `p_ErrorMsg` VARCHAR(500))   BEGIN
