    BEGIN
        GET DIAGNOSTICS CONDITION 1 p_ErrorMsg = MESSAGE_TEXT;
        SET p_Status = -1;
        SET p_OverrideId = NULL;
    END;
    -- Validation
    IF p_ProcedureName IS NULL OR TRIM(p_ProcedureName) = '' THEN
        SET p_Status = -2;
