CREATE DEFINER=`root`@`localhost` PROCEDURE `sys_parameter_prefix_overrides_Delete_ById` (IN `p_OverrideId` INT, IN `p_ModifiedBy` VARCHAR(50), OUT `p_Status` INT, OUT `p_ErrorMsg` VARCHAR(500))   BEGIN
