CREATE DEFINER=`root`@`localhost` PROCEDURE `usr_users_Get_ByUser` (IN `p_User` VARCHAR(100), OUT `p_Status` INT, OUT `p_ErrorMsg` VARCHAR(500))   BEGIN
    DECLARE v_Count INT DEFAULT 0;
    -- Transaction management removed: Works within caller's transaction context (tests use transactions)`r`n    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
        GET DIAGNOSTICS CONDITION 1
            p_ErrorMsg = MESSAGE_TEXT;
        SET p_Status = -1;
    END;
    IF p_User IS NULL OR TRIM(p_User) = '' THEN
        SET p_Status = -2;
        SET p_ErrorMsg = 'User is required';
    ELSE
        -- Return combined data from usr_users and usr_settings
        SELECT 
            u.*,
            JSON_UNQUOTE(JSON_EXTRACT(s.SettingsJson, '$.VisualUserName')) AS VisualUserName,
            JSON_UNQUOTE(JSON_EXTRACT(s.SettingsJson, '$.VisualPassword')) AS VisualPassword
        FROM usr_users u
        LEFT JOIN usr_settings s ON u.User = s.UserId
        WHERE u.`User` = p_User;
        
        SELECT FOUND_ROWS() INTO v_Count;
        IF v_Count > 0 THEN
            SET p_Status = 1;
            SET p_ErrorMsg = CONCAT('Retrieved user "', p_User, '"');
        ELSE
            SET p_Status = 0;
            SET p_ErrorMsg = CONCAT('User "', p_User, '" not found');
        END IF;
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `usr_users_SetUserSetting_ByUserAndField` (IN `p_User` VARCHAR(100), IN `p_Field` VARCHAR(100), IN `p_Value` VARCHAR(500), OUT `p_Status` INT, OUT `p_ErrorMsg` VARCHAR(500))   BEGIN
    DECLARE v_RowsAffected INT DEFAULT 0;
    DECLARE v_AllowedFields VARCHAR(1000) DEFAULT 'LastShownVersion,HideChangeLog';
    
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
        GET DIAGNOSTICS CONDITION 1
            p_ErrorMsg = MESSAGE_TEXT;
        SET p_Status = -1;
    END;
    
    IF p_User IS NULL OR TRIM(p_User) = '' THEN
        SET p_Status = -2;
        SET p_ErrorMsg = 'User is required';
    ELSEIF p_Field IS NULL OR TRIM(p_Field) = '' THEN
        SET p_Status = -3;
        SET p_ErrorMsg = 'Field is required';
    ELSEIF FIND_IN_SET(p_Field, v_AllowedFields) = 0 THEN
        SET p_Status = -4;
        SET p_ErrorMsg = CONCAT('Field "', p_Field, '" is not in allowed fields list: ', v_AllowedFields);
    ELSE
        
        SET @sql = CONCAT('UPDATE usr_users SET ', p_Field, ' = ? WHERE User = ?');
        PREPARE stmt FROM @sql;
        SET @value = p_Value;
        SET @user = p_User;
        EXECUTE stmt USING @value, @user;
        DEALLOCATE PREPARE stmt;
        
        SET v_RowsAffected = ROW_COUNT();
        
        IF v_RowsAffected > 0 THEN
            SET p_Status = 1;
            SET p_ErrorMsg = CONCAT('Updated field "', p_Field, '" for user "', p_User, '"');
        ELSE
            SET p_Status = 0;
            SET p_ErrorMsg = CONCAT('User "', p_User, '" not found');
        END IF;
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `usr_users_Update_User` (IN `p_User` VARCHAR(100), IN `p_FullName` VARCHAR(200), IN `p_Shift` VARCHAR(50), IN `p_Pin` VARCHAR(50), IN `p_VisualUserName` VARCHAR(50), IN `p_VisualPassword` VARCHAR(50), OUT `p_Status` INT, OUT `p_ErrorMsg` VARCHAR(500))   BEGIN
    DECLARE v_RowCount INT DEFAULT 0;
    DECLARE v_SettingsJson JSON;
    -- Transaction management removed: Works within caller's transaction context (tests use transactions)`r`n    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
        GET DIAGNOSTICS CONDITION 1
            p_ErrorMsg = MESSAGE_TEXT;
        SET p_Status = -1;
    END;
    IF p_User IS NULL OR TRIM(p_User) = '' THEN
        SET p_Status = -2;
        SET p_ErrorMsg = 'User is required';
    ELSE
        -- Update core user info in usr_users
        UPDATE usr_users SET
            `Full Name` = p_FullName,
            `Shift` = p_Shift,
            `Pin` = p_Pin
        WHERE `User` = p_User;
        SET v_RowCount = ROW_COUNT();
        
        IF v_RowCount > 0 THEN
            -- Update settings in usr_settings.SettingsJson
            UPDATE usr_settings
            SET SettingsJson = JSON_SET(
                COALESCE(SettingsJson, JSON_OBJECT()),
                '$.VisualUserName', p_VisualUserName,
                '$.VisualPassword', p_VisualPassword
            )
            WHERE UserId = p_User;
            
            -- If no settings row exists, create one
            IF ROW_COUNT() = 0 THEN
                VALUES (
                    p_User,
                    JSON_OBJECT(
                        'VisualUserName', p_VisualUserName,
                        'VisualPassword', p_VisualPassword
                    ),
                    JSON_OBJECT()
                );
            END IF;
            
            SET p_Status = 1;
            SET p_ErrorMsg = CONCAT('User "', p_User, '" updated successfully');
        ELSE
            SET p_Status = -4;
            SET p_ErrorMsg = CONCAT('User "', p_User, '" not found');
        END IF;
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `usr_user_shortcuts_GetByUser` (IN `p_UserName` VARCHAR(50))   BEGIN
    SELECT 
        s.ShortcutName,
        COALESCE(u.CustomKeys, s.ShortcutKeys) as EffectiveKeys,
        s.Description,
        s.Category,
        CASE WHEN u.CustomKeys IS NOT NULL THEN 1 ELSE 0 END as IsCustom
    FROM sys_shortcuts s
    LEFT JOIN usr_user_shortcuts u ON s.ShortcutName = u.ShortcutName AND u.UserName = p_UserName;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `usr_user_shortcuts_Reset` (IN `p_UserName` VARCHAR(50))   BEGIN
    DELETE FROM usr_user_shortcuts WHERE UserName = p_UserName;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `usr_user_shortcuts_Upsert` (IN `p_UserName` VARCHAR(50), IN `p_ShortcutName` VARCHAR(100), IN `p_CustomKeys` INT)   BEGIN
    VALUES (p_UserName, p_ShortcutName, p_CustomKeys)
    ON DUPLICATE KEY UPDATE CustomKeys = p_CustomKeys;
END$$

